import React from 'react';

const Header = () => {
    return (
        <header>
            <h1>My Website</h1>
            <nav>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
